        <Carousel>
            <Carousel.Item>
                <img className = "d-block w-100"
                src = {motoIMG}
                alt="First Slide"
                />
                <Carousel.Caption>
                    <h3>Cafe Racer forever</h3>
                    <p>hahahaha</p>
                </Carousel.Caption>

                
            </Carousel.Item>
        </Carousel>
    )
}
